import React from 'react';
import { Container, TextField, Button, Grid } from '@mui/material';

const CadastroScreen = () => {
  return (
    <Container maxWidth="xs">
      <Grid container spacing={2} justifyContent="flex-end" alignItems="center" style={{ height: '100vh' }}>
        <Grid item xs={12}>
          <div style={{ padding: '20px', borderRadius: '8px', boxShadow: '0px 2px 10px rgba(0, 0, 0, 0.1)' }}>
            <h2>Cadastro</h2>
            <TextField label="Nome" variant="outlined" fullWidth />
            <TextField label="Email" variant="outlined" fullWidth style={{ marginTop: '10px' }} />
            <TextField label="Senha" type="password" variant="outlined" fullWidth style={{ marginTop: '10px' }} />
            <Button variant="contained" color="secondary" fullWidth style={{ marginTop: '20px' }}>
              Cadastrar
            </Button>
          </div>
        </Grid>
      </Grid>
    </Container>
  );
}

export default CadastroScreen;
